import { createStore } from 'redux';

interface State {
    message: string;
}

const initialState: State = {
    message: 'Hello, World!'
};

const reducer = (state = initialState, action: { type: string }) => {
    switch (action.type) {
        default:
            return state;
    }
};

const store = createStore(reducer);

export default store;
